import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';


function Login() {

    const inputStyle = makeStyles((theme) => ({
        root: {
            '& > *': {
                margin: theme.spacing(1),
                width: '39ch',
            },            
        },
    }));
    const classes = inputStyle();

    const useStyles = makeStyles((theme) => ({
        container: {
          display: 'flex',
          flexWrap: 'wrap',
        },
        textField: {
          marginLeft: theme.spacing(1),
          marginRight: theme.spacing(1),
          width: 200,
        },
      }));




    return (

        <div>
            <form className={classes.root} noValidate autoComplete="off">
                <TextField id="outlined-basic" label="First Name" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Last Name" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Email" variant="outlined" /><br />
                <TextField id="outlined-basic" label="Password" variant="outlined" /><br />


            </form>
        </div>
    )
}


export default Login;
